import React, { Component } from 'react'
import Header from "./components/Header"
import "../styles/blog/style.css"

export default class Blog extends Component {

    componentDidMount() {
        document.title = "Blog - Codemunit";
      }

    render() {
        return (
            <div className="blog">
                <Header hero="blog-bg">

                </Header>
            </div>
        )
    }
}
